const users = [
  "Aman",
  "Riya",
  "Rahul",
  "Sneha",
  "Karan",
];

const SideBar = () => {
  return (
    <aside className="w-64 bg-slate-800 text-white h-[calc(100vh-56px)] border-r border-slate-700">
      <div className="p-4 font-semibold text-gray-300 border-b border-slate-700">
        Users
      </div>

      <ul className="overflow-y-auto">
        {users.map((user, index) => (
          <li
            key={index}
            className="px-4 py-3 hover:bg-slate-700 cursor-pointer flex items-center gap-3"
          >
            <div className="w-8 h-8 rounded-full bg-indigo-500 flex items-center justify-center">
              {user.charAt(0)}
            </div>
            <span>{user}</span>
          </li>
        ))}
      </ul>
    </aside>
  );
};

export default SideBar;
